import MovieCard from "./MovieCard";
import {Container, Grid} from "@material-ui/core";
import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles({
  root: {
    padding: "0 5 5",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    margin: 50,
  },
});

const movies = [
    {
        name: "Gunpowder Milkshake",
        imgPath: "http://127.0.0.1:5000/static/images/gunpowder.jpg",
        description: "The film stars Karen Gillan as a young assassin who must team up with her estranged assassin mother (Lena Headey) and her former assassin colleagues (Carla Gugino, Michelle Yeoh, and Angela Bassett) in order to save a young girl (Chloe Coleman) from other assassins.",
        rate: 6,
        date: "July 14, 2021"
    },
        {
        name: "Cruella",
        imgPath: "http://127.0.0.1:5000/static/images/cruella.jpg",
        description: "",
        rate: 0,
        date: ""
    },
            {
        name: "",
        imgPath: "http://127.0.0.1:5000/static/images/",
        description: "",
        rate: 0,
        date: ""
    },
];

export default function ViewMovies() {
    const classes = useStyles();
    return (
        <Container className={classes.root}>
            <Grid spacing={2} container justifyContent="center" alignItems="center">
                <Grid item>
                    <MovieCard date={movies[0].date} rate={movies[0].rate} title={movies[0].name} image={movies[0].imgPath} description={movies[0].description} />
                </Grid>
                 <Grid item>
                    <MovieCard date={movies[0].date} rate={movies[0].rate} title={movies[0].name} image={movies[0].imgPath} description={movies[0].description} />
                </Grid>
                 <Grid item>
                    <MovieCard date={movies[0].date} rate={movies[0].rate} title={movies[0].name} image={movies[0].imgPath} description={movies[0].description} />
                </Grid>
            </Grid>
        </Container>
    );
}
